selector_to_html = {"a[href=\"#solutions-of-exercise-2-1\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Solutions of Exercise 2.1<a class=\"headerlink\" href=\"#solutions-of-exercise-2-1\" title=\"Link to this heading\">#</a></h1><p>We want to design a proportional controller <span class=\"math notranslate nohighlight\">\\(F(s)=K\\)</span> for a tooling machine.\nIn the <a class=\"reference internal\" href=\"#fig-lec2-ex1-sol-rlocus\"><span class=\"std std-ref\">Root Locus plot</span></a>, the poles of the closed-loop system <span class=\"math notranslate nohighlight\">\\(G_c(s) = \\frac{F(s)G(s)}{1 + F(s)G(s)}\\)</span> are drawn as a function of the controller gain <span class=\"math notranslate nohighlight\">\\(K\\)</span>.</p><p>Use the <a class=\"reference internal\" href=\"#fig-lec2-ex1-sol-rlocus\"><span class=\"std std-ref\">Root Locus plot</span></a> to specify what values of <span class=\"math notranslate nohighlight\">\\(K\\)</span> have been used to generate the step responses depicted in the figure below.</p>", "a[href=\"#solution\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Solution<a class=\"headerlink\" href=\"#solution\" title=\"Link to this heading\">#</a></h2><h3>Plot 1<a class=\"headerlink\" href=\"#plot-1\" title=\"Link to this heading\">#</a></h3><p>Plot 1 corresponds to an <strong>over-damped closed-loop response</strong>, as no oscillation is visible. This implies that the closed-loop poles are real-valued. Looking at the <a class=\"reference internal\" href=\"#fig-lec2-ex1-sol-rlocus\"><span class=\"std std-ref\">Root Locus plot</span></a>, the closed-loop eigenvalues are negative real-valued for <span class=\"math notranslate nohighlight\">\\(0 &lt; K \\leq 0.2\\)</span>.</p>", "a[href=\"#plot-4\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Plot 4<a class=\"headerlink\" href=\"#plot-4\" title=\"Link to this heading\">#</a></h3><p>Plot 4 showns a stable, but oscillatory, closed-loop response. The  dominant closed-loop poles are complex conjugate. This case corresponds to <span class=\"math notranslate nohighlight\">\\(0.2 &lt; K &lt; 11\\)</span>.</p>", "a[href=\"#plot-3\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Plot 3<a class=\"headerlink\" href=\"#plot-3\" title=\"Link to this heading\">#</a></h3><p>Plot 3 depicts a marginally stable closed-loop response, i.e., the closed-loop poles have null real part. Therefore, this case corresponds to <span class=\"math notranslate nohighlight\">\\(K = 11\\)</span>.</p>", "a[href=\"#plot-2\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Plot 2<a class=\"headerlink\" href=\"#plot-2\" title=\"Link to this heading\">#</a></h3><p>Plot 2 depicts an unstable and oscillatory closed-loop response, meaning that the closed-loop poles have a large imaginary part and a positive real part. From the <a class=\"reference internal\" href=\"#fig-lec2-ex1-sol-rlocus\"><span class=\"std std-ref\">Root Locus plot</span></a> we can see that this is the case for <span class=\"math notranslate nohighlight\">\\(K &gt; 11\\)</span>.</p>", "a[href=\"#fig-lec2-ex1-sol-resp\"]": "<figure class=\"align-default\" id=\"fig-lec2-ex1-sol-resp\">\n<a class=\"reference internal image-reference\" href=\"../_images/ex1b.png\"><img alt=\"../_images/ex1b.png\" src=\"../_images/ex1b.png\" style=\"height: 400px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 12 </span><span class=\"caption-text\">Closed-loop step responses</span><a class=\"headerlink\" href=\"#fig-lec2-ex1-sol-resp\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#plot-1\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Plot 1<a class=\"headerlink\" href=\"#plot-1\" title=\"Link to this heading\">#</a></h3><p>Plot 1 corresponds to an <strong>over-damped closed-loop response</strong>, as no oscillation is visible. This implies that the closed-loop poles are real-valued. Looking at the <a class=\"reference internal\" href=\"#fig-lec2-ex1-sol-rlocus\"><span class=\"std std-ref\">Root Locus plot</span></a>, the closed-loop eigenvalues are negative real-valued for <span class=\"math notranslate nohighlight\">\\(0 &lt; K \\leq 0.2\\)</span>.</p>", "a[href=\"#fig-lec2-ex1-sol-rlocus\"]": "<figure class=\"align-default\" id=\"fig-lec2-ex1-sol-rlocus\">\n<a class=\"reference internal image-reference\" href=\"../_images/ex1a.png\"><img alt=\"../_images/ex1a.png\" src=\"../_images/ex1a.png\" style=\"height: 400px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 11 </span><span class=\"caption-text\">Root Locus plot</span><a class=\"headerlink\" href=\"#fig-lec2-ex1-sol-rlocus\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: false,
                placement: 'auto-start', maxWidth: 500, interactive: true, boundary: document.body, appendTo: document.body,
                onShow(instance) {MathJax.typesetPromise([instance.popper]).then(() => {var isFirefox=typeof InstallTrigger!=='undefined';if(isFirefox&&window.MathJax&&MathJax.startup&&MathJax.startup.output&&MathJax.startup.output.name==="SVG"){const svgs=instance.popper.querySelectorAll('svg');svgs.forEach(svg=>{let bbox=svg.getBBox(),x=bbox.x,y=bbox.y,width=bbox.width,height=bbox.height;svg.setAttribute('width',width);svg.setAttribute('height',height);svg.setAttribute('viewBox',`${x} ${y} ${width} ${height}`);});let rescale=0.015;svgs.forEach(svg=>{let bbox=svg.getBBox(),width=bbox.width,height=bbox.height;svg.setAttribute('width',width*rescale);svg.setAttribute('height',height*rescale);});}});},
            });
        };
    };
    console.log("tippy tips loaded!");
};
